import React from 'react';
import vwCSS from './viewWriteStories.css';
import WriteStory from './WriteStory';

function ViewWriteStories(props) {
  let imageURl;
  if(props == "Green-Lake-Stories"){
    imageURL = "./images/The_Refuge.jpg";
  }
  else if(props == "Ghibli-House-Stories"){
    imageURL = "./images/Ghibili_House.jpg";
  }
  else if(props == "Carosel-Stories"){
    imageURL = "./images/Carosel_Path.jpg";
  }
  else {
    imageURL = "./images/Cooling_Mist.jpg";
  }
  return (
    <div>
        <img src = "./images/The_Refuge.jpg" id = "Normal_Ghibili_House" height = "150"  alt = "Ghibili_House"></img>
        <WriteStory artURL = {props.artwork} />
    </div>
  )
}

export default ViewWriteStories;
